// En el archivo GlobalRouter.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Asegúrate de importar Routes

import Overview from './views/Overview';

function GlobalRouter() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/articulos" element={<Overview />} />
      </Routes>
    </BrowserRouter>
  );
}

export default GlobalRouter;
